svg.script:

var w = document.getElementById('iran-svg');
w.addEventListener('load', function()
{
	for (var i = 0; i < w.querySelectorAll('g > path').length; i++)
	{
		if ( w.querySelectorAll('g > path')[i].hasAttribute('id') )
		{
			w.querySelectorAll('g > path')[i].onmousemove = function(event)
			{
				var id = this.querySelectorAll('desc > name')[0].textContent;
			}
		}
	}

	function shuffle()
	{
		var min  = 0;
		var max  = w.querySelectorAll('g > path').length;
		var rand = Math.floor(Math.random() * (max - min + 1)) + min;
		var path = w.querySelectorAll('g > path')[rand];
		if(path)
		{
			var name = path.querySelectorAll('desc > name')[0].textContent;
			console.log(name);
			path.setAttribute('class', 'st1 selected');
			setTimeout(function()
			{
				path.setAttribute('class', 'st1');
			}, 3100);
		}
	}

	setInterval(function()
	{
		shuffle();
	}, 3000);
 }, false);
